            <div className="currentPlan">  
            <h1 className="textStyle">Current Plan</h1>
            <img src={cube} alt="Cube" className="cubeStyle"></img>

            <p className="ptextStyle">$299.99</p>
            <h1 className="textStyle">Current Plan</h1>
            <img src={cube} alt="Cube" className="cubeStyle2"></img>
            <p className="ptextStyle">$299.99</p>
            
            </div>
            </Stack>
        </div>
    )
}
